import useFetch from './service/service';
import './App.css';


function App(id) {
  const {user, loading, error} = useFetch(id)
  // const {activity, loading, error} = useFetch("http://localhost:3000/user/12/activity")
  // const {sessions} = useFetch(`http://localhost:3000/user/12/average-sessions`)
  // const {performance} = useFetch(`http://localhost:3000/user/12/performance`)

  if(loading) return <h1>LOADING ...</h1>
  if(error) console.log(error);

  return (
    <div className="App">
        <button>User
          {user?.data.id}
        </button>
    </div>
  );
}

export default App;
